function Hobbies() {
    return (
        <div className="Hobbies">
            <h2>Hobbies</h2>
            <ul>
                <li>Reading</li>
                <li>Watching movie</li>
                <li>Playing volleyball</li>
                <li>sleep</li>
            </ul>
          <header className="Hobbies-header">
            <img src={picture} className="Profile-image" alt="image" />
            <p>
              "Hello! My name is Xinran Zhang."
            </p>
          </header>
        </div>
      );

}

export default Hobbies;
